webpackJsonp([0xd82749271489],{1099:function(e,t){e.exports={data:{markdownRemark:{html:'<p>It was a challenging yet rewarding period in the last two months. I have set up the bare-bones structure of my personal site, yet it was a long way until perfect. Without much resources on the Internet, coming up with a decent design and functional website is a long learning process. In the last two months, I have managed to: </p>\n<ul>\n<li>Revamped landing page with new design and content. I have added my service section and an about section with <a href="http://react-simple-maps.io">React Simple Map</a> as background (but it could function so much more)</li>\n<li>Revamped work page design. The section background is dynamic now to match every projects\' brand color (manually input from the markdown files).</li>\n<li>Added mobile navigation and animation with some icons that I drew.</li>\n<li>Added 404 Page. One small step for man, one giant leap for mankind.</li>\n<li>Added <a href="http://localhost:8000/categories/ui-ux-design">Work Category Page</a>, each service can be viewed individually with relevant projects</li>\n<li>Enhanced landing page experience by cool reveal animation using <a href="https://www.react-reveal.com/">React-Reveal</a></li>\n<li>Enhanced scroll animation using <a href="https://github.com/mauricevancooten/react-anchor-link-smooth-scroll">React Anchor Link Smooth Scroll</a> when you click Get In Touch on landing page</li>\n<li>Enhanced blog reading experience especially with code block. Code will highlight according to the language using <a href="https://www.gatsbyjs.org/packages/gatsby-remark-prismjs/">Gatsby-Remark-PrismicJS</a></li>\n<li>Enhanced footer design by replacing the author component, also added social media links and contact access.</li>\n<li>All blog posts have a feature image now on the top</li>\n<li>Fixed related post referenced to <a href="https://github.com/Vagr9K/gatsby-material-starter/blob/master/gatsby-node.js">Gatsby Material Starter</a> node.js</li>\n<li>Fixed code block overflow problem in blog</li>\n<li>Fixed Footer Width Problem</li>\n<li>Fixed Tag &#x26; Category with multiple words in slug using <a href="https://lodash.com/docs#kebabCase">kebabCase</a></li>\n</ul>',excerpt:"It was a challenging yet rewarding period in the last two months. I have set up the bare-bones structure of my personal site, yet it was a long way until perfect. Without much resources on the Internet, coming up with a decent design and functionalâ€¦",frontmatter:{path:"/2018-Oct-Update",title:"desktopofsamuel.com October Update",date:"October 31, 2018",tags:["Work In Progress","gatsby"],intro:null,image:{publicURL:"/static/2018-Oct-281afc9299ee91440b90388e386217ed.png",size:34978,childImageSharp:{sizes:{base64:"data:image/png;base64,",aspectRatio:1.9047619047619047,src:"/static/2018-Oct-281afc9299ee91440b90388e386217ed-93616.png",srcSet:"/static/2018-Oct-281afc9299ee91440b90388e386217ed-79678.png 285w,\n/static/2018-Oct-281afc9299ee91440b90388e386217ed-bd37c.png 570w,\n/static/2018-Oct-281afc9299ee91440b90388e386217ed-93616.png 1140w,\n/static/2018-Oct-281afc9299ee91440b90388e386217ed-1cd99.png 1200w",srcWebp:"/static/2018-Oct-281afc9299ee91440b90388e386217ed-7e863.webp",srcSetWebp:"/static/2018-Oct-281afc9299ee91440b90388e386217ed-54d6b.webp 285w,\n/static/2018-Oct-281afc9299ee91440b90388e386217ed-d8e8b.webp 570w,\n/static/2018-Oct-281afc9299ee91440b90388e386217ed-7e863.webp 1140w,\n/static/2018-Oct-281afc9299ee91440b90388e386217ed-428ea.webp 1200w",sizes:"(max-width: 1140px) 100vw, 1140px"}}}},fields:{nextTitle:"Undraw",nextSlug:"/undraw",prevTitle:"Practical Tips on Evernote",prevSlug:"/practical-evernote-tips",slug:"/2018-oct-update"}}},pathContext:{}}}});
